

data class CityAndDelta(val cityByLocationItem: CityByLocationItem, val delta: Double)
data class CityByLocationItem(
    val city: String,
    val region: String,
    val okr: String,
    val lat: Double,
    val lng: Double
)

class CityByLocation {
    companion object {
        fun getCloserCity(lat: Double, lng: Double): CityAndDelta {
            val delta = listOfData.map {
                val deltaLat = if (it.lat > lat) it.lat - lat else lat - it.lat
                val deltaLng = if (it.lng > lng) it.lng - lng else lng - it.lng
                CityAndDelta(it, deltaLat + deltaLng)
            }
            val sortedDelta = delta.sortedBy { it.delta }
            return sortedDelta[0]
        }

